coefficientsToFunctions[weight_]:=coefficientsToFunctions[weight]=functionsToCoefficients[weight]/.Rule[x_,y_]:>Rule[y,x];
collinearFunctionsWeight[n_]:=collinearFunctionsWeight[n]=DeleteCases[functionsWeight[n]/.{Alternatives@@allIrreducibleFunctions->0}/.{1-u->-S^2}/.{1-v->S^2}/.{1-w->T}/.toHPL/.{Times[-1,exp__]:>Times[exp]/;exp=!=S^2}/.HPL[{__,1},T]->0/.HPL[{__,1},S^2]->0/.HPL[{1},T]->Log[T]/.HPL[{1},S^2]->Log[S^2],0];
collinearFunctionsToCoefficients[weight_]:=(collinearFunctionsToCoefficients[weight]=Table[collinearFunctionsWeight[weight][[i]]->col[weight,i],{i,Length@collinearFunctionsWeight[weight]}])/;weight<8;
(*coefficientsLeft[func_]:=Length[DeleteDuplicates[Flatten[Reap[func/.{Ve[i_]:>Sow[Ve[i]],Vo[i_]:>Sow[Vo[i]]}][[2]]]]];*)
combinedConstraints[constraintList_]:=ToRules[Reduce[Join@@constraintList/.Rule[x_,y_]:>Equal[x,y]]];
coproductV[weights_,func_]:=Module[{currentWeight,numVe,numVo,array},
	currentWeight=transcendentalWeight[First[func]/.{Ve[_]->Random[],Vo[_]->Random[]}];
	numVe=Length[Select[functionsWeight[currentWeight],EvenQ[yGrading[#]]&]];
	numVo=Length[Select[functionsWeight[currentWeight],OddQ[yGrading[#]]&]];
	array=Normal[CoefficientArrays[func,Join[Array[Ve,numVe],Array[Vo,numVo]]]];
	If[Length[array]>2\[Or]!FreeQ[array[[1]],Alternatives[Ve[_],Vo[_]]],Print["unexpected coefficients in coproductV"]];
	Expand[coproduct[weights,array[[1]]]+Sum[Ve[i]coproduct[weights,array[[2,i]]],{i,numVe}]+Sum[Vo[i-numVe]coproduct[weights,array[[2,i]]],{i,numVe+1,numVe+numVo}]]/.toHPL];
coproductEntryV[func_,var_]:=Module[{currentWeight,numVe,numVo,array},
	currentWeight=transcendentalWeight[First[func]/.{Ve[_]->Random[],Vo[_]->Random[]}];
	numVe=Length[Select[functionsWeight[currentWeight],EvenQ[yGrading[#]]&]];
	numVo=Length[Select[functionsWeight[currentWeight],OddQ[yGrading[#]]&]];
	array=Normal[CoefficientArrays[func,Join[Array[Ve,numVe],Array[Vo,numVo]]]];
	If[Length[array]>2\[Or]!FreeQ[array[[1]],Alternatives[Ve[_],Vo[_]]],Print["unexpected coefficients in coproductEntryV"]];
	Expand[coproductEntry[array[[1]],var]+Sum[Ve[i]coproductEntry[array[[2,i]],var],{i,numVe}]+Sum[Vo[i-numVe]coproductEntry[array[[2,i]],var],{i,numVe+1,numVe+numVo}]]/.toHPL]
constraintRules[0,_]:={};
constraintRules[func_,weight_]:=Module[{eqns},
	eqns=CoefficientArrays[func/.toMPL/.functionsToCoefficients[weight],Table[c[weight,i],{i,Length@functionsWeight[weight]}]];
	If[eqns[[1]]!={},Print["unrecognized functions not inculded in equation solving"]];
	If[Length[eqns]==2,ToRules[Reduce[Normal[eqns[[2]]]==ConstantArray[0,Length@functionsWeight[weight]]]],Print["unexpected coefficients in constraintRules"]]];
collinearConstraintRules[func_,weight_]:=Module[{eqns},
	eqns=CoefficientArrays[Expand[func/.toHPL/.HPL[arg_,vec_]:>HPLexpand[HPL[arg,vec/.uvwToFST],{T,0,0}]/.irreducibleFunctionsToCollinearExpansion[0]]/.collinearFunctionsToCoefficients[6],Table[col[6,i],{i,Length@collinearFunctionsWeight[6]}]];
	If[eqns[[1]]!={},Print["unrecognized functions in collinearConstraintRules"]];
	If[Length[eqns]==2,ToRules[Reduce[Normal[eqns[[2]]]==ConstantArray[0,Length[collinearFunctionsWeight[weight]]]]],Print["unexpected functions in collinearConstraintRules"]]];
supuriousPoleConstraintRules[func_]:=Module[{expression,expressionVars,eqns},
	expression=coproductV[max,func-(func/.cycle/.cycle)]/.toLogs/.{Log[yu]->Log[1-w]+Log[u]+Log[1-v]-2 Log[u-v],Log[yv]->2Log[u-v]-Log[1-w]-Log[v]-Log[1-u],Log[yw]->Log[1-u]-Log[1-v]}/.Log[w]->0/.CircleDot[a__]:>coprod[a];
	expressionVars=DeleteDuplicates[Flatten[Reap[Expand[expression]/.{coprod[i__]:>Sow[coprod[i]]}][[2]]]];
	eqns=CoefficientArrays[expression,expressionVars];
	If[eqns[[1]]!={},Print["unrecognized functions not inculded in equation solving"]];If[Length[eqns]==2,ToRules[Reduce[Normal[eqns[[2]]]==ConstantArray[0,Length@expressionVars]]],Print["unexpected coefficients in constraintRules"]]];
